from math import hypot

def will_robot_reach_target(a: int, b: int, s: str) -> str:
    (dx, dy) = (0, 0)
    for move in s:
        if move == 'R':
            dx += 1
        elif move == 'L':
            dx -= 1
        elif move == 'D':
            dy -= 1
        elif move == 'U':
            dy += 1
    if dx == a or dy == b:
        return 'Yes'
    if dx == 0 and dy == 0:
        return 'Yes' if a == 0 and b == 0 else 'No'
    lngt = int(max(0, hypot(a, b) / hypot(dx, dy) - 500))
    (x, y) = (dx * lngt, dy * lngt)
    for _ in range(1000):
        for move in s:
            if x == a and y == b:
                return 'Yes'
            if move == 'R':
                x += 1
            elif move == 'L':
                x -= 1
            elif move == 'D':
                y -= 1
            elif move == 'U':
                y += 1
            if x == a and y == b:
                return 'Yes'
    return 'No'

